import React from 'react';
import db from "../../db.json"
import ItemCarrito from "./ItemCarrito"

function Carrito() {

    const carrito = db.Carrito
    var total = db.Carrito.total


    return (
        <>
            {carrito.map((info, i) => (
                <div key={i}>
                    <ItemCarrito prenda={info} />
                </div>
            ))}
            <div>
            <p>precio en total: {total}</p>
            <p></p>    
            </div>
        </>
    );
}

export default Carrito;
